Method.Source:
    [Form]
    public final class ProdUpdateJour extends FormRun
    {
        QueryBuildRange                     criteriaStatusCostEstimation;
        QueryBuildRange                     criteriaStatusScheduling;
        QueryBuildRange                     criteriaStatusSchedulingMethod;
        QueryBuildRange                     criteriaStatusRelease;
        QueryBuildRange                     criteriaStatusStart;
        QueryBuildRange                     criteriaStatusReportFinished;
        QueryBuildRange                     criteriaStatusHistoricalCost;

        ParmJobStatus                       criteriaJobStatus;
        Integer                             startTab;

}

void changeLoss(ProdParmType    type)
{
    switch (type)
    {
        case ProdParmType::CostEstimation       :
            CostEstimationPage.activatePage();
            prodParmCostEstimation_ds.executeQuery();
            prodParmCostEstimation_ds.refresh();
            break;

        case ProdParmType::OperationScheduling  :
            MasterSchedulingPage.activatePage();
            prodParmScheduling_ds.executeQuery();
            prodParmScheduling_ds.refresh();
            break;

        case ProdParmType::JobScheduling        :
            DetailSchedulingPage.activatePage();
            prodParmScheduling_ds.executeQuery();
            prodParmScheduling_ds.refresh();
            break;

        case ProdParmType::Release              :
            ReleasePage.activatePage();
            prodParmRelease_ds.executeQuery();
            prodParmRelease_ds.refresh();
            break;

        case ProdParmType::StartUp              :
            StartUpPage.activatePage();
            prodParmStartUp_ds.executeQuery();
            prodParmStartUp_ds.refresh();
            break;

        case ProdParmType::ReportFinished       :
            ReportFinishedPage.activatePage();
            prodParmReportFinished_ds.executeQuery();
            prodParmReportFinished_ds.refresh();
            break;

        case ProdParmType::HistoricalCost       :
            EndPage.activatePage();
            prodParmHistoricalCost_ds.executeQuery();
            prodParmHistoricalCost_ds.refresh();
            break;

        default                                 :
            break;
    }
}

void init()
{
    super();

    criteriaJobStatus       = ParmJobStatus::Waiting;
    startTab                = 0;

    Scrap_ScrapAccount.parmPostingType(LedgerPostingType::None);
}

void executeQuery()
{
    ProdSchedMethod m;

    if (ctrlUpdate.selectionAsProdParmType() == ProdParmType::OperationScheduling)
        m = ProdSchedMethod::OperationScheduling;
    else
        m = ProdSchedMethod::JobScheduling;

    criteriaStatusSchedulingMethod.value(strfmt('%1',m));
    criteriaStatusScheduling.value(strfmt('!%1',criteriaJobStatus));

    super();
}

int selectionChange()
{
    int ret;

    ret = super();

    element.changeLoss(ctrlUpdate.selectionAsProdParmType());

    return ret;
}
